description:
Шопинг в «Подружке» стал ещё удобнее — теперь в твоём смартфоне! Самые выгодные предложения и твои любимые бьюти-хиты по низким ценам уже здесь. Мы приготовили для тебя эксклюзивные скидки, акции и промокоды на расширенный онлайн ассортимент. 

· Скачивай приложение прямо сейчас и получи скидку 30% на первый заказ в приложении!
· Ставь лайки любимым товарам и выбирай из списка проверенных брендов.
· Получай актуальную информацию обо всех акциях и не упусти свою выгоду.

Косметика и парфюмерия из России, Азии, Европы и США уже ждут тебя в мобильном приложении. Все бестселлеры и новинки от MIXIT, Celimax, A`Pieu, Loreal, Eveline, Nivea, Kensuko, Catrice, Dewytree, Kharisma Voltage, Vivienne Sabo, «Витэкс», «Чистая Линия», Levrana, Gillette, Garnier, Natura Siberica, Hada Labo, JMSolution и других известных брендов совсем рядом. 

«Подружка» следит за трендами. Какую бы систему заботы о коже ты ни выбрала: минималистичную, эко, натуральную, антистресс или SOS-уход — в приложении найдется всё необходимое. И даже больше! Более 300 новинок каждый месяц.

Это всё в твоём кармане:
· декоративная косметика;
· аксессуары для макияжа;
· уход за лицом, телом и волосами;
· акции и скидки на духи и парфюм;
· корейская косметика; 
· бьюти-средства для мужчин;
· безопасные средства для детей; 
· товары для личной гигиены;
· бытовая химия для уборки дома; 
· здоровое питание;
· канцелярские товары;
· стильные аксессуары и бижутерия. 

А еще у нас: 

Скидки каждый день
Для держателей дисконтных карт магазина «Подружка» действует скидка от 3 до 25%! Оформляй карту лояльности и не упусти возможность попробовать новинки сезона по приятным ценам.

Удобная доставка
Теперь доставка стала ещё быстрее и проще! Забери свой заказ в ближайшем магазине «Подружка» в твоём городе – бесплатно от любой суммы заказа. Просто выбери всё необходимое, и при наличии товара мы соберем твой заказ прямо с полок магазина! Забрать заказ можно в тот же день, хранение – 3 дня!

Безопасная оплата
Доступны варианты оплаты через приложение или при получении, а также частями. Оплатить заказ можно наличными и банковской картой.

Подарочные карты
Есть повод порадовать близких? Выручит подарочный сертификат «Подружки» номиналом от 300 до 5000 рублей. 

Давай дружить!
Каждый день мы становимся лучше для тебя. Оцени работу приложения и оставь свой отзыв, чтобы мы сделали его еще удобнее!

Хочешь пообщаться?
